// Move Encoding
#define encode(homesq, trgtsq, piece, pmt_flg, cpt_flg, dbl_flg, ep_flg, cst_flg)   \
	(homesq) | (trgtsq << 6) | (piece << 12) | (pmt_flg << 16) | (cpt_flg << 20) |  \
	(dbl_flg << 21) | (ep_flg << 22) | (cst_flg << 23)
#define decode_homesq(move) (move & 0x3f)
#define decode_trgtsq(move) ((move & 0xfc0) >> 6)
#define decode_piece(move) ((move & 0xf000) >> 12)
#define decode_pmt_flg(move) ((move & 0xf0000) >> 16)
#define decode_cpt_flg(move) (move & 0x100000)
#define decode_dbl_flg(move) (move & 0x200000)
#define decode_ep_flg(move) (move & 0x400000)
#define decode_cst_flg(move) (move & 0x800000)

